  width: 100%;
  height: 100%;
  margin: 0;
  font-family: verdana;
  box-sizing: border-box;
  padding-bottom: 25px;
}
.pdb-root svg {
  display: block;
}
.pdb-renderer .pdb-root {
  padding-bottom: 0;
}
.pdb-title {
  text-align: center;
}

.pdb-legend {
  text-align: center;
}
.pdb-legend .entry {
  display: inline-block;
  padding: 5px 15px 5px 5px;
  margin-right: 5px;
  cursor: pointer;
}
.pdb-legend .entry:hover {
  background: rgba(255,255,255,0.5);
  transform: scale(1.2);
}
.pdb-legend .entry .mark {
  display: inline-block;
  width: 14px;
  height: 14px;
  border-radius: 50%;
  vertical-align: middle;
  margin-right: 5px;
}
.pdb-legend .entry .name {
  display: inline-block;
  vertical-align: middle;
}
.pdb-popup {
  position: absolute;
  background: rgba(0,0,0,1.0);
  color: #fff;
  padding: 5px 10px;
  border-radius: 5px;
  display: none;
}
.pdb-popup .title, .popup .desc {
  margin-left: 23px;
}
.pdb-popup .mark {
  width: 14px;
  height: 14px;
  border-radius: 50%;
  background: #fff;
  position: absolute;
  left: 10px;
  top: 5px;
}
.pdb-popup:after {
  content: " ";
  display: block;
  width: 10px;
  height: 10px;
  background: #ff0;
  position: absolute;
  transform: rotate(45deg);
  background: rgba(0,0,0,1.0);
  top: 50%;
  margin-top: -5px;
}
.pdb-popup.left:after {
  right: -5px;
}
.pdb-popup.right:after {
  left: -5px;
}

.pdb-popup.float {
  position: absolute;
  top: 100px;
  left: 100px;
  background: #fff;
  border: 1px solid #ccc;
  box-shadow: 0 2px 2px rgba(0,0,0,0.3);
  border-radius: 2px;
  width: 120px;
  height: 45px;
  margin-left: -60px;
  margin-top: 30px;
  padding: 10px 5px;
  display: none;
  text-align: center;
  color: #000;
  font-size: 0.8em;
}
.pdb-popup.float:after {
  display: none;
}
.pdb-popup.float .title {
  height: 20px;
  font-size: 1.2em;
  font-weight: bold;
  margin: 0;
}
.pdb-popup.float .desc {
  font-weight: bold;
  font-size: 0.8em;
  margin: 0;
  margin-bottom: 5px;
}
.pdb-popup.float .value {
  font-size: 0.9em;
}

.hover-box,.hover-margin { position:absolute;z-index:99999;pointer-events:none }
.hover-box { border:1px dashed red }
.hover-margin { border:1px dashed rgba(255,192,0,0.5) }

.axis .domain, .axis .tick line {
  fill: none;
  stroke: #000;
}

#plotdb-mark {
  position: fixed;
  z-index: 999999;
  bottom: 5px;
  right: 5px;
  text-align: center;
  font-size: 12px;
  font-family: optima;
  cursor: pointer;
  color: #000;
  text-decoration: none;
  padding: 5px;
  border-radius: 3px;
  -webkit-touch-callout: none;
  -webkit-user-select: none;
  -khtml-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  width: auto;
  height: 16px;
  box-sizing: border-box;
  padding-right: 20px;
  font-size: 12px;
  line-height: 8px;
  color: #999;
  font-family: arial;
}

ounty"></path></svg></div></div><script src="DivergingTaiwanCounty_files/sdk.js" id="facebook-jssdk"></script><script src="DivergingTaiwanCounty_files/analytics.js" async=""></script><script type="text/javascript" src="DivergingTaiwanCounty_files/view.js"></script><script type="text/javascript">var chart = {"ownername":"teinhonglo","key":1191,"name":"Diverging Taiwan County","owner":122,"theme":null,"parent":1061,"description":"diverging version of choropleth ( Color-mapped geographic blocks ) for Taiwan, in county resolution.","basetype":[],"visualencoding":[],"category":[],"tags":[],"likes":null,"searchable":true,"dimlen":2,"createdtime":"2016-06-19T17:27:07.000Z","modifiedtime":"2016-06-19T17:43:47.000Z","doc":{"name":"document","size":117,"type":"html","lines":5,"content":"<div id=\"chartPopup\">\n  <div id=\"chartTitle\"></div>\n  <div id=\"chartTime\"></div>\n  <div id=\"chartValue\"></div>\n</div>"},"style":{"name":"stylesheet","size":524,"type":"css","lines":31,"content":"#chartPopup {\n  position: absolute;\n  top: 100px;\n  left: 100px;\n  background: #fff;\n  border: 1px solid #ccc;\n  box-shadow: 0 2px 2px rgba(0,0,0,0.3);\n  border-radius: 2px;\n  width: 120px;\n  height: 45px;\n  margin-left: -60px;\n  margin-top: 30px;\n  padding: 10px 5px;\n  display: none;\n  text-align: center;\n  box-sizing: content-box;\n}\n#chartTitle {\n  height: 20px;\n  font-size: 1.2em;\n  font-weight: bold;\n}\n#chartTime {\n  font-weight: bold;\n  font-size: 0.8em;\n  margin-bottom: 5px;\n}\n\n#chartValue {\n  font-size: 0.9em;\n}"},"code":{"name":"code","size":4877,"type":"javascript","lines":126,"content":"module = {};\nmodule.exports = plotdb.chart.create({\n  sample:  [\"雲林縣\", \"桃園市\", \"台東縣\", \"新北市\", \"台北市\", \"台南市\", \"台中市\", \"屏東縣\", \"南投縣\", \"苗栗縣\", \"基隆市\", \"高雄市\", \"宜蘭縣\", \"花蓮縣\", \"新竹縣\", \"新竹市\", \"嘉義縣\", \"嘉義市\", \"彰化縣\", \"連江縣\", \"澎湖縣\", \"金門縣\"].map(function(it) {\n    return {\"縣市名\": it, \"數值\": Math.random() * 100 - 50};\n  }),\n  dimension: {\n    \"數值\": { type: [plotdb.Number], require: true, desc: \"該縣市的數值\" },\n    \"縣市名\": { type: [], require: false, desc: \"縣市的名字，用來對應地圖\" }\n  },\n  config: {\n    padding: { type: [plotdb.Number], default: 10, rebindOnChange: true },\n    emptyColor: { type: [plotdb.Color], default: \"#000\"},\n    negative: { type: [plotdb.Color], default: \"#e92\"},\n    positive: { type: [plotdb.Color], default: \"#29e\"},\n    strokeColor: { type: [plotdb.Color], default: \"#444\"},\n    cut: { name: \"diverge Point\", type: [plotdb.Number], default: 0}\n  },\n  init: function() {\n    this.svg = d3.select(this.root).append(\"svg\").attr({\n      width: \"100%\", height: \"100%\",\n      viewBox: \"0 0 800 600\",\n      preserveAspectRatio: \"xMidYMid\"\n    });\n  },\n  normalname: function(it) {\n    if(it == \"台北縣\") return \"新北市\";\n    if(it == \"台中縣\") return \"台中市\";\n    if(it == \"高雄縣\") return \"高雄市\";\n    if(it == \"台南縣\") return \"台南市\";\n    if(it == \"桃園縣\") return \"桃園市\";\n    return it;\n  },\n  bind: function() {\n    var that = this;\n    this.countyfile = this.assets[\"twCounty2010.topo.json\"];\n    this.path = d3.geo.path().projection(\n      function(coord) {\n        if(coord[1]>25.5) coord[1] = coord[1] - 1;\n        if(coord[0]<119) coord[0] = coord[0] + 1.2;\n        return d3.geo.mercator().center([121,24]).scale(6000)(coord);\n      }\n    );\n    for(var idx = 0; idx < this.data.length; idx++ ) {\n      var item = this.data[idx];\n      item[\"縣市名\"] = item[\"縣市名\"].replace(/臺/g, \"台\").substring(0,3); \n    }\n    var countymap = d3.nest().key(function(it) { return it[\"縣市名\"]; }).entries(this.data);\n    for(var idx = 0; idx < countymap.length; idx++ ) {\n      countymap[idx].value = d3.mean(countymap[idx].values.map(function(it) { return parseInt(it[\"數值\"]); }));\n    }\n    this.data = countymap.map(function(it) { return {\"縣市名\": it.key, \"數值\": it.value};});\n    d3.json(this.countyfile.datauri, function(ret) {\n      var features = topojson.feature(ret, ret.objects.layer1).features;\n      for(var i = 0; i < features.length; i++) {\n        features[i].properties.COUNTYNAME = that.normalname(features[i].properties.COUNTYNAME);\n      }\n      that.counties = features;\n      for(var idx = 0; idx < features.length ; idx++) {\n        matched = that.data.filter(function(it) {\n          return it[\"縣市名\"] == features[idx].properties.COUNTYNAME;\n        })[0];\n        if(matched) {\n          features[idx].properties.value = matched[\"數值\"];\n        }\n      }\n      that.valuerange = d3.extent(features.map(function(it) { return it.properties.value; }));\n      that.cscale = d3.scale.linear()\n        .domain([that.valuerange[0], (that.config.cut || 0), that.valuerange[1]])\n        .range([that.config.negative, \"#eee\", that.config.positive]);\n      that.svg.selectAll(\"path.county\").data(features)\n        .enter().append(\"path\").attr({class: \"county\"})\n        .on(\"mousemove\",function(it) {\n          var box = that.root.getBoundingClientRect();\n          var x = d3.event.clientX;\n          var y = d3.event.clientY;\n          d3.select(\"#chartTitle\").text(it.properties.COUNTYNAME);\n          d3.select(\"#chartValue\").text(\n            (it.properties.value == undefined ? \"無數值\"\n             :parseInt(it.properties.value*100)/100)\n          );\n          d3.select(\"#chartPopup\").style({\n            display: \"block\",\n            top: y - (box.top) + \"px\",\n            left: x - (box.left) + \"px\"\n          });\n          if(that.hidePopup) clearTimeout(that.hidePopup);\n        }).on(\"mouseout\",function(it) {\n          if(that.hidePopup) clearTimeout(that.hidePopup);\n          that.hidePopup = setTimeout(function() {\n            d3.select(\"#chartPopup\").style({\n              display: \"none\"\n            });\n          },1000);\n        });\n      that.render();\n    });\n  },\n  resize: function() {\n    if(this.valuerange) {\n      this.cscale = d3.scale.linear()\n        .domain([this.valuerange[0], (this.config.cut || 0), this.valuerange[1]])\n        .range([this.config.negative, \"#eee\", this.config.positive]);\n    }\n  },\n  render: function() {\n    var that = this;\n    this.svg.selectAll(\"path.county\")\n      .attr({\n        \"d\": that.path,\n        \"fill\": function(it) {\n          var v = it.properties.value;\n          if(!v) return that.config.emptyColor;\n          return that.cscale(v);\n        },\n        \"stroke\": function(it) {\n          if(!it.properties.value) return that.config.emptyColor;\n          return that.config.strokeColor;\n        },\n        opacity: function(it) {\n          if(!it.properties.value) return 0.2;\n          return 1;\n        },\n        \"stroke-width\": 2\n      });\n  }\n});"},"permission":{"value":[],"switch":["public"]},"assets":[{"name":"twCounty2010.topo.json","type":"application/json","content":"eyJ0eXBlIjoiVG9wb2xvZ3kiLCJ0cmFuc2Zvcm0iOnsic2NhbGUiOlswLjAwMDE2MDIxMTc3NzM5NTIyMzUsMC4wMDAxNjA2ODI2MTM3MjUyNjQ3Ml0sInRyYW5zbGF0ZSI6WzExOC4yMTcwNzEyMzE2OTEwNSwyMS44OTY3MTYwNjI1MzI2Ml19LCJvYmplY3RzIjp7ImxheWVyMSI6eyJ0eXBlIjoiR2VvbWV0cnlDb2xsZWN0aW9uIiwiZ2VvbWV0cmllcyI6W3sidHlwZSI6bnVsbCwicHJvcGVydGllcyI6eyJDT1VOVFlTTiI6IjEwMDA5MDAxIiwiQ09VTlRZTkFNRSI6Iumbsuael+e4oyJ9fSx7InR5cGUiOm51bGwsInByb3BlcnRpZXMiOnsiQ09VTlRZU04iOiIxMDAwOTAwMiIsIkNPVU5UWU5BTUUiOiLpm7LmnpfnuKMifX0seyJ0eXBlIjoiUG9seWdvbiIsImFyY3MiOltbMF1dLCJwcm9wZXJ0aWVzIjp7IkNPVU5UWVNOIjoiMTAwMDkwMDMiLCJDT1VOVFlOQU1FIjoi6Zuy5p6X57ijIn19LHsidHlwZSI6IlBvbHlnb24iLCJhcmNzIjpbWzFdXSwicHJvcGVydGllcyI6eyJDT1VOVFlTTiI6IjEwMDA5MDA0IiwiQ09VTlRZTkFNRSI6Iumbsuael+e4oyJ9fSx7InR5cGUiOiJQb2x5Z29uIiwiYXJjcyI6W1syXV0sInByb3BlcnRpZXMiOnsiQ09VTlRZU04iOiIxMDAwOTAwNSIsIkNPVU5UWU5BTUUiOiLpm7LmnpfnuKMifX0seyJ0eXBlIjpudWxsLCJwcm9wZXJ0aWVzIjp7IkNPVU5UWVNOIjoiMTAwMDkwMDYiLCJDT1VOVFlOQU1FIjoi6Zuy5p6X57ijIn19LHsidHlwZSI6bnVsbCwicHJvcGVydGllcyI6eyJDT1VOVFlTTiI6IjEwMDA5MDA3IiwiQ09VTlRZTkFNRSI6Iumbsuael+e4oyJ9fSx7InR5cGUiOm51bGwsInByb3BlcnRpZX
